/* ai-robot-avatar.js - 3D PNG avatar (embedded, no paths) */
(function () {
  'use strict';

  var DATA_URI = "data:image/png;base64,";

  function ensureStyle() {
    if (document.getElementById('aiRobot3DStyle')) return;
    var css = `
/* === AI Robot 3D Avatar (Embedded PNG) === */
.avatar{ position:relative; overflow:hidden !important; border-radius:999px; }
.avatar img{ opacity:0 !important; pointer-events:none; }

.ai-robot-3d{
  position:absolute; inset:0;
  border-radius:999px;
  overflow:hidden;
  pointer-events:none;
  z-index: 6;
}
.ai-robot-3d img{
  width:100%;
  height:100%;
  object-fit: cover;
  display:block;
  transform: scale(1.06);
  filter: drop-shadow(0 10px 16px rgba(0,0,0,0.45));
  will-change: transform, filter;
}

/* idle */
.ai-robot-3d.is-idle img{ animation: rbIdle 6.2s ease-in-out infinite; }
@keyframes rbIdle{ 0%,100%{ transform: scale(1.06) translateY(0); } 50%{ transform: scale(1.08) translateY(-1.6px); } }

/* wave: tiny rotate + bounce (feels like greeting) */
.ai-robot-3d.is-wave img{ animation: rbWave 900ms ease-in-out both; }
@keyframes rbWave{
  0%{ transform: scale(1.06) rotate(0deg); }
  20%{ transform: scale(1.08) rotate(6deg); }
  45%{ transform: scale(1.08) rotate(-4deg); }
  70%{ transform: scale(1.08) rotate(5deg); }
  100%{ transform: scale(1.06) rotate(0deg); }
}

/* point: lean slightly toward the right/down (toward your buttons) */
.ai-robot-3d.is-point img{ animation: rbPoint 900ms cubic-bezier(.22,.61,.36,1) both; }
@keyframes rbPoint{
  0%{ transform: scale(1.06) translate(0,0); }
  55%{ transform: scale(1.08) translate(6px, 6px); }
  100%{ transform: scale(1.06) translate(0,0); }
}

/* wink: quick glow pulse (subtle) */
.ai-robot-3d.is-wink img{ animation: rbWink 650ms ease-in-out both; }
@keyframes rbWink{
  0%{ filter: drop-shadow(0 10px 16px rgba(0,0,0,0.45)); }
  45%{ filter: drop-shadow(0 10px 16px rgba(0,0,0,0.45)) brightness(1.10) contrast(1.05); }
  100%{ filter: drop-shadow(0 10px 16px rgba(0,0,0,0.45)); }
}

@media (prefers-reduced-motion: reduce){
  .ai-robot-3d.is-idle img,
  .ai-robot-3d.is-wave img,
  .ai-robot-3d.is-point img,
  .ai-robot-3d.is-wink img{ animation:none !important; }
}
`;
    var style = document.createElement('style');
    style.id = 'aiRobot3DStyle';
    style.textContent = css;
    document.head.appendChild(style);
  }

  function mount(imgId) {
    var img = document.getElementById(imgId);
    if (!img) return;
    var avatar = img.closest('.avatar');
    if (!avatar) return;

    ensureStyle();

    // avoid duplicate
    if (avatar.querySelector('.ai-robot-3d')) return;

    // keep avatar.js intact but hide visual avatar image
    img.style.opacity = '0';

    var wrap = document.createElement('div');
    wrap.className = 'ai-robot-3d is-idle';
    var robotImg = document.createElement('img');
    robotImg.alt = 'AI Robot';
    robotImg.src = DATA_URI;
    wrap.appendChild(robotImg);
    avatar.appendChild(wrap);

    function seq(){
      // wave -> point -> wink (short + clean)
      wrap.classList.remove('is-wave','is-point','is-wink');
      // wave
      setTimeout(function(){ wrap.classList.add('is-wave'); }, 350);
      // point
      setTimeout(function(){ wrap.classList.remove('is-wave'); wrap.classList.add('is-point'); }, 1600);
      // wink
      setTimeout(function(){ wrap.classList.remove('is-point'); wrap.classList.add('is-wink'); }, 2850);
      // back to idle
      setTimeout(function(){ wrap.classList.remove('is-wink'); }, 3600);
    }

    setTimeout(seq, 1200);
    setInterval(seq, 26000);
  }

  document.addEventListener('DOMContentLoaded', function () {
    mount('mine-avatar');
    mount('account-avatar');
  });
})();
